function fillImgs(pics, adress, folder) {
    for(let imgData of pics) {
        const [imgName, imgWidth, imgHeight] = imgData;
        const img = document.createElement("img");
        img.src=`materials/${folder}/${imgName}`;
        img.width=imgWidth;
        img.height=imgHeight;
        img.alt="img";
        const gimg = document.createElement("div");
        gimg.className="gimg";
        gimg.append(img);
        const gtxtS = document.createElement("div");
        gtxtS.className="gtxtS";
        gtxtS.innerHTML = imgWidth + "x" + imgHeight;
        const dataLine = document.createElement("div");
        dataLine.append(gimg);
        dataLine.append(gtxtS);
        adress.append(dataLine);
    }
};

function hidePics() {
    for(let field of [glyphicons, flat, black18, black24, black48, black192, white18, white24, white48, white192]) {
        field.classList.remove("show");
    }
};

